import React from 'react';
import { Link } from 'react-router-dom';
import { Router } from 'react-router-dom';

const Navbar = () => {
    return (
        <Router>
            <Link to="/">Home</Link>
            <Link to="/Contact">Contact</Link>
        </Router>
    );
}




export default Navbar;
